        "summary": "Black Garlic Noodles – Umami blast is a <b>dairy free</b> main course. One serving contains <b>521 calories</b>, <b>16g of protein</b>, and <b>11g of fat</b>. This recipe serves 2 and costs 69 cents per serving. From preparation to the plate, this recipe takes about <b>10 minutes</b>. A mixture of cilantro, garlic, noodles, and a handful of other ingredients are all it takes to make this recipe so delicious. To use up the soy sauce you could follow this main course with the <a href=\"https://spoonacular.com/recipes/panna-cotta-with-strawberry-vin-santo-sauce-154216\">Panna Cotta with Strawberry-Vin Santo Sauce</a> as a dessert. 140 people have made this recipe and would make it again. All things considered, we decided this recipe <b>deserves a spoonacular score of 90%</b>. This score is awesome. Try <a href=\"https://spoonacular.com/recipes/triple-black-garlic-noodles-10009\">Triple Black Garlic Noodles</a>, <a href=\"https://spoonacular.com/recipes/clean-eating-garlic-shrimp-with-black-bean-noodles-626270\">Clean Eating Garlic Shrimp with Black Bean Noodles</a>, and <a href=\"https://spoonacular.com/recipes/umami-ketchup-82571\">Umami Ketchup</a> for similar recipes.",
