        "summary": "Leftover Mashed Potatoes Gnocchi could be just the <b>dairy free and lacto ovo vegetarian</b> recipe you've been looking for. One serving contains <b>160 calories</b>, <b>6g of protein</b>, and <b>1g of fat</b>. This recipe serves 4 and costs 17 cents per serving. 1 person found this recipe to be flavorful and satisfying. <b>Thanksgiving</b> will be even more special with this recipe. Only a few people really liked this Mediterranean dish. It works well as a side dish. From preparation to the plate, this recipe takes roughly <b>20 minutes</b>. This recipe from Life as a Strawberry requires don't forget to read the recipe notes before you start - they'll help you make the best gnocchi possible, egg, salt, and flour. All things considered, we decided this recipe <b>deserves a spoonacular score of 22%</b>. This score is not so spectacular. Try <a href=\"https://spoonacular.com/recipes/shepherds-pie-aka-how-to-use-up-leftover-mashed-potatoes-577410\">Shepherd’s Pie AKA How to Use Up Leftover Mashed Potatoes</a>, <a href=\"https://spoonacular.com/recipes/turkey-shepherds-pie-with-leftover-mashed-potatoes-405809\">Turkey Shepherd's Pie with Leftover Mashed Potatoes</a>, and <a href=\"https://spoonacular.com/recipes/leftover-mashed-potato-soup-122032\">Leftover Mashed Potato Soup</a> for similar recipes.",
