        "summary": "Spicy Chicken Tomato Soup might be just the main course you are searching for. This recipe makes 8 servings with <b>224 calories</b>, <b>17g of protein</b>, and <b>8g of fat</b> each. For <b>$1.05 per serving</b>, this recipe <b>covers 13%</b> of your daily requirements of vitamins and minerals. Several people made this recipe, and 523 would say it hit the spot. It will be a hit at your <b>Autumn</b> event. Head to the store and pick up chicken broth, ground cumin, corn tortillas, and a few other things to make it today. To use up the salt you could follow this main course with the <a href=\"https://spoonacular.com/recipes/apple-turnovers-recipe-48175\">Apple Turnovers Recipe</a> as a dessert. It is a good option if you're following a <b>gluten free and dairy free</b> diet. From preparation to the plate, this recipe takes about <b>4 hours and 20 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 82%</b>. This score is spectacular. Try <a href=\"https://spoonacular.com/recipes/spicy-tomato-soup-26699\">Spicy Tomato Soup</a>, <a href=\"https://spoonacular.com/recipes/spicy-tomato-soup-26845\">Spicy Tomato Soup</a>, and <a href=\"https://spoonacular.com/recipes/spicy-tomato-soup-27054\">Spicy Tomato Soup</a> for similar recipes.",
