        "summary": "You can never have too many main course recipes, so give Creamy Curry Chicken Salad Wraps a try. This recipe serves 8. One serving contains <b>152 calories</b>, <b>22g of protein</b>, and <b>5g of fat</b>. For <b>$1.21 per serving</b>, this recipe <b>covers 14%</b> of your daily requirements of vitamins and minerals. 1 person found this recipe to be delicious and satisfying. It is a <b>reasonably priced</b> recipe for fans of Indian food. It is brought to you by Analida's Ethnic Spoon. From preparation to the plate, this recipe takes around <b>35 minutes</b>. If you have chicken breast, greek yogurt, cashews, and a few other ingredients on hand, you can make it. All things considered, we decided this recipe <b>deserves a spoonacular score of 0%</b>. This score is very bad (but still fixable). Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/curry-chicken-salad-wraps-378770\">Curry Chicken Salad Wraps</a>, <a href=\"https://spoonacular.com/recipes/5-minute-curry-chicken-salad-lettuce-wraps-1011207\">5-Minute Curry Chicken Salad Lettuce Wraps</a>, and <a href=\"https://spoonacular.com/recipes/chicken-kitchen-creamy-curry-salad-dressing-594082\">chicken kitchen creamy curry salad dressing</a>.",
