        "summary": "Salmon Potato Cakes with Mustard Tartar Sauce might be just the main course you are searching for. Watching your figure? This gluten free and pescatarian recipe has <b>235 calories</b>, <b>18g of protein</b>, and <b>8g of fat</b> per serving. This recipe serves 2 and costs $2.23 per serving. 1 person has tried and liked this recipe. If you have nonfat cream, creole seasoning, grainy mustard, and a few other ingredients on hand, you can make it. To use up the lemon juice you could follow this main course with the <a href=\"https://spoonacular.com/recipes/lemon-shortbread-cookies-with-lemon-icing-a-tribute-to-aunt-roxanne-487814\">Lemon Shortbread Cookies with Lemon Icing {A Tribute to Aunt Roxanne}</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 62%</b>. This score is solid. Similar recipes are <a href=\"https://spoonacular.com/recipes/whole30-salmon-cakes-with-tartar-sauce-763458\">Whole30 Salmon Cakes with Tartar Sauce</a>, <a href=\"https://spoonacular.com/recipes/salmon-cakes-with-artichoke-tartar-sauce-754868\">Salmon Cakes with Artichoke Tartar Sauce</a>, and <a href=\"https://spoonacular.com/recipes/spicy-salmon-cakes-with-mango-tartar-sauce-295990\">Spicy Salmon Cakes with Mango Tartar Sauce</a>.",
