        "summary": "The recipe Spaghetti Carbonara could satisfy your Mediterranean craving in approximately <b>40 minutes</b>. For <b>$1.76 per serving</b>, you get a main course that serves 6. One serving contains <b>507 calories</b>, <b>20g of protein</b>, and <b>18g of fat</b>. Head to the store and pick up pepper, spaghetti, salt, and a few other things to make it today. 221 person found this recipe to be flavorful and satisfying. It is brought to you by Fifteen Spatulas. With a spoonacular <b>score of 0%</b>, this dish is very bad (but still fixable). If you like this recipe, you might also like recipes such as <a href=\"https://spoonacular.com/recipes/spaghetti-carbonara-175753\">Spaghetti Carbonara</a>, <a href=\"https://spoonacular.com/recipes/spaghetti-carbonara-549332\">Spaghetti Carbonara</a>, and <a href=\"https://spoonacular.com/recipes/spaghetti-carbonara-77061\">Spaghetti Carbonara</a>.",
