        "summary": "Pesto Pasta with Chicken might be just the main course you are searching for. This recipe makes 8 servings with <b>323 calories</b>, <b>15g of protein</b>, and <b>9g of fat</b> each. For <b>96 cents per serving</b>, this recipe <b>covers 12%</b> of your daily requirements of vitamins and minerals. This recipe from Allrecipes requires skinless boneless chicken breasts, garlic, oil packed sun dried tomatoes, and red pepper flakes. 1235 people have tried and liked this recipe. It is a good option if you're following a <b>dairy free</b> diet. From preparation to the plate, this recipe takes about <b>30 minutes</b>. Taking all factors into account, this recipe <b>earns a spoonacular score of 83%</b>, which is tremendous. Similar recipes are <a href=\"https://spoonacular.com/recipes/chicken-pesto-pasta-449623\">Chicken Pesto Pasta</a>, <a href=\"https://spoonacular.com/recipes/pesto-chicken-pasta-435359\">Pesto Chicken Pasta</a>, and <a href=\"https://spoonacular.com/recipes/chicken-pesto-pasta-544236\">Chicken Pesto Pasta</a>.",
