        "instructions": "<ol><li><span class=\"recipe-directions__list--item\">Bring a large pot of lightly salted water to a boil. Add pasta and cook for 8 to 10 minutes or until al dente; drain.</span></li><li><span class=\"recipe-directions__list--item\">Heat oil in a large skillet over medium heat. Saute garlic until tender, then stir in chicken. Season with red pepper flakes. Cook until chicken is golden, and cooked through.</span></li><li><span class=\"recipe-directions__list--item\">In a large bowl, combine pasta, chicken, sun-dried tomatoes and pesto. Toss to coat evenly.</span></li></ol>",
