        "summary": "Pasta salad with tuna, capers & balsamic dressing could be just the <b>dairy free, lacto ovo vegetarian, and vegan</b> recipe you've been looking for. One serving contains <b>538 calories</b>, <b>16g of protein</b>, and <b>13g of fat</b>. This recipe serves 4. For <b>$2.91 per serving</b>, this recipe <b>covers 32%</b> of your daily requirements of vitamins and minerals. A few people really liked this main course. Head to the store and pick up orecchiette pasta, celery heart, olive oil, and a few other things to make it today. From preparation to the plate, this recipe takes about <b>20 minutes</b>. 32 people have made this recipe and would make it again. It is brought to you by BBC Good Food. All things considered, we decided this recipe <b>deserves a spoonacular score of 99%</b>. This score is outstanding. If you like this recipe, you might also like recipes such as <a href=\"https://spoonacular.com/recipes/whole-wheat-pasta-salad-with-beans-capers-balsamic-yogurt-dressing-584466\">Whole Wheat Pasta Salad with Beans, Capers & Balsamic Yogurt Dressing</a>, <a href=\"https://spoonacular.com/recipes/potato-and-tuna-salad-with-capers-and-dijon-dressing-89668\">Potato and Tuna Salad With Capers and Dijon Dressing</a>, and <a href=\"https://spoonacular.com/recipes/tuna-carpaccio-with-watercress-salad-and-balsamic-dressing-8069\">Tuna Carpaccio with Watercress Salad and Balsamic Dressing</a>.",
