        "summary": "Turkey Pasta Bolognese might be a good recipe to expand your main course recipe box. For <b>$2.66 per serving</b>, this recipe <b>covers 23%</b> of your daily requirements of vitamins and minerals. One portion of this dish contains around <b>35g of protein</b>, <b>5g of fat</b>, and a total of <b>402 calories</b>. This recipe serves 8. It is a good option if you're following a <b>dairy free</b> diet. If you have spaghetti al dente according to package directions, onion, garlic, and a few other ingredients on hand, you can make it. From preparation to the plate, this recipe takes approximately <b>20 minutes</b>. 1 person found this recipe to be flavorful and satisfying. It is brought to you by Skinny Ms. With a spoonacular <b>score of 0%</b>, this dish is improvable. Similar recipes are <a href=\"https://spoonacular.com/recipes/crockpot-turkey-bolognese-pasta-sauce-474589\">Crockpot Turkey Bolognese Pasta Sauce</a>, <a href=\"https://spoonacular.com/recipes/slow-cooker-turkey-bolognese-pasta-sauce-923717\">Slow Cooker Turkey Bolognese Pasta Sauce</a>, and <a href=\"https://spoonacular.com/recipes/zucchini-pasta-with-quick-and-easy-turkey-bolognese-542373\">Zucchini Pasta with Quick and Easy Turkey Bolognese</a>.",
