        "instructions": "Instructions\n\nHeat large skillet over medium high heat. Add olive oil.\n\nAdd onion, garlic, carrots, celery and ground turkey, breaking up meat into small pieces as it cooks. Cook until onions and garlic are soft, and meat is almost cooked through.\n\nAdd tomato paste and italian seasoning and combine, cooking until tomato paste is a copper color.\n\nPour in red wine and combine. Reduce heat and simmer until wine is almost absorbed.\n\nAdd 1/2 cup beef broth and cook until almost absorbed.\n\nAdd additional 1/2 cup of beef broth and stir, adding salt & pepper.\n\nSimmer an additional 5 minutes, or until sauce is slightly thickened.\n\nServe over prepared pasta.",
