        "summary": "Garlicky Orzo with Roasted Vegetables might be just the side dish you are searching for. One serving contains <b>293 calories</b>, <b>7g of protein</b>, and <b>15g of fat</b>. For <b>$1.14 per serving</b>, this recipe <b>covers 14%</b> of your daily requirements of vitamins and minerals. Many people made this recipe, and 509 would say it hit the spot. If you have olive oil, handful of cherry tomatoes, baby orange bell pepper, and a few other ingredients on hand, you can make it. From preparation to the plate, this recipe takes about <b>35 minutes</b>. It is a good option if you're following a <b>dairy free</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 97%</b>. This score is amazing. Try <a href=\"https://spoonacular.com/recipes/orzo-with-garlicky-roasted-tomatoes-and-parmesan-497288\">Orzo with Garlicky Roasted Tomatoes and Parmesan</a>, <a href=\"https://spoonacular.com/recipes/garlicky-pot-roast-with-roasted-potatoes-root-vegetables-255845\">Garlicky Pot Roast with Roasted Potatoes & Root Vegetables</a>, and <a href=\"https://spoonacular.com/recipes/roasted-vegetables-with-orzo-426421\">Roasted Vegetables with Orzo</a> for similar recipes.",
