        "summary": "You can never have too many main course recipes, so give Oven-Roasted Catfish with Creole Vegetables a try. This recipe makes 4 servings with <b>392 calories</b>, <b>26g of protein</b>, and <b>14g of fat</b> each. For <b>$2.56 per serving</b>, this recipe <b>covers 27%</b> of your daily requirements of vitamins and minerals. This recipe is liked by 7 foodies and cooks. Head to the store and pick up baby lima beans, butter, chicken broth, and a few other things to make it today. To use up the cooked white rice you could follow this main course with the <a href=\"https://spoonacular.com/recipes/healthy-raw-chocolate-pudding-516858\">Healthy Raw Chocolate Pudding</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 85%</b>. This score is great. Try <a href=\"https://spoonacular.com/recipes/oven-roasted-catfish-2071\">Oven-roasted Catfish</a>, <a href=\"https://spoonacular.com/recipes/herb-roasted-salmon-with-creole-vegetables-34806\">Herb Roasted Salmon with Creole Vegetables</a>, and <a href=\"https://spoonacular.com/recipes/oven-roasted-vegetables-105112\">Oven-Roasted Vegetables</a> for similar recipes.",
